class Navi extends React.Component{
    render(){
        return(
            <div>
 

        <h4>BAK-ONE</h4>
        <h6 id="navi">one page</h6>
        <li id="hello">Home</li>
        <li id="hello">Online payment</li>
        <li id="hello">About</li>
        <li id="hello">Contact</li>
      </div>
        )
    }
    
}
export default Navi;
